import * as React from 'react';

export const PeopleHost = () => {
  return (
    <div className='bg-red-300 w-full max-w-5xl mx-auto'>
      <div className='py-16'>
        <div>
          <h3>
            Over 2 million people host on Airbnb and no host's style is the
            same.
          </h3>
        </div>
        <div>
          <a href=''>Learn what's expected of hosts</a>
        </div>
      </div>
    </div>
  );
};
